import { combineReducers, createStore } from "redux";
import { datareducerc } from "./reducer/categoryReducer";
import { datareucerg } from "./reducer/gameReducer";
import { datareducerL } from "./reducer/loginReducer";
import { datareducerS } from "./reducer/salBuyReducer";
import { datareducercu } from "./reducer/customerReducer";
import { datareducerB } from "./reducer/buyReducer";

const reducer=combineReducers({datareducerc,datareucerg,datareducerL,datareducerS,datareducercu,datareducerB});


export const mystore=createStore(reducer)
window.store=mystore
